function updateUniforms(model,context,fs){
    let newIndex = model._pointLight.length;
    //console.log(newIndex,model._pointLight);

    var silhouette = hasSilhouette(model, fs);
    var translucent = isTranslucent(model);

    var nodeCommands = model._nodeCommands;
    var length = nodeCommands.length;
    for (let i in nodeCommands) {
        let nc = nodeCommands[i];
        var command = translucent ? nc.translucentCommand : nc.command;
        command = silhouette ? nc.silhouetteModelCommand : command;
        let um = command.uniformMap;
        for(let j = 0;j < newIndex;j++){//let j
            um['xh_pointLightPosition' + j] = function(){
                //console.log(j,model._pointLight[j]);
                return Matrix4.multiplyByPoint( context.uniformState._view3D,model._pointLight[j],new Cartesian3);
            };
        }
    }
}

